import React from 'react';
import { Card } from 'react-bootstrap';
// import { Link } from 'react-router-dom';
// import SkillIcons from './SkillIcons';
import Transparent_APIs_Databases from '../assets/Transparent_APIs_Databases.png';
import Transparent_Design_Development from '../assets/Transparent_Design_Development.png';
import Transparent_Systems_Engineering from '../assets/Transparent_Systems_Engineering.png';
import './portfolio.css';

const images = [
   {
      src: Transparent_Design_Development,
      alt: 'gallery image',
      title: 'Design & Development',
      desc: 'Description of project and technologies used maybe some icons'
   },
   {
      src: Transparent_APIs_Databases,
      alt: 'gallery image',
      title: 'Dashboards & Databases',
      desc: 'Description of project and technologies used maybe some icons'
   },
   {
      src: Transparent_Systems_Engineering,
      alt: 'gallery image',
      title: 'API & Systems Engineering',
      desc: 'Description of project and technologies used maybe some icons'
   }
];

export default function Portfolio() {
   return (
      <div className='portfolio-content text-center'>
         <div className='row'>
            {images.map((image, i) => (
               <div key={i} className='col-md-4 col-12'>
                  <div className='card rounded-circle'>
                     <img
                        src={image.src}
                        className='card-img-top rounded-circle'
                        alt={image.alt}
                     />
                     <div className='card-body'>
                        <h5 className='card-title'>{image.title}</h5>
                        {/* <p className='card-text'>{image.desc}</p> */}
                        {/* <Link to='/portfolio' className='btn btn-primary'>
                           See more
                        </Link> */}
                     </div>
                     <Card className='bg-dark text-white'>
                        <Card.Img src='holder.js/100px270' alt='Card image' />
                        <Card.ImgOverlay>
                           <Card.Title>Card title</Card.Title>
                           <Card.Text>
                              This is a wider card with supporting text below as a
                              natural lead-in to additional content. This content is a
                              little bit longer.
                           </Card.Text>
                           <Card.Text>Last updated 3 mins ago</Card.Text>
                        </Card.ImgOverlay>
                     </Card>
                  </div>
               </div>
            ))}
         </div>
      </div>
   );
}
